window.bookSummaryJSON = "<p>A hair-raising ambush. A malfunctioning ship. A distant, uncharted part of the Universe.</p> <p>Calexa Acura and her crew of misfits are lost, and their ship is in desperate need of repairs. When a massive spacecraft appears in their radius, they're helpless to resist its magnetic pull.</p> <p>The terrifying ship is bigger than any craft she's seen in her life, and somehow, she doubts its occupants will turn out to be the friendly sort.</p> <p>First Encounters are always better when they're amicable, but if necessary, Calexa and her crew will fight.</p> <p>It's what they've always done.</p> <p>Contains mature themes.</p>"; 
